import logo from './logo.svg';
import './App.css';
import Post from './Post';
import Header from './Header';
import {Routes,Route} from 'react-router'
import Layout from './Layout';

function App() {
  return (
    <Routes>
      <Route path='/' element={<Layout/>}></Route>
      <Route index element ={
        <Post/>
      } />
      <Route path={'/login'} element={
          <div>Login Page</div>
      }></Route>
    </Routes>

  );
}

export default App;
